import React from "react";
import { Box, Heading, Divider } from "@chakra-ui/react";

function TrendingProduct(props) {
  // eslint-disable-next-line

  return (
    <>
      <ProdContainer {...props}>
        <ProdContainerHeader />
      </ProdContainer>
    </>
  );
}
const ProdContainerHeader = () => {
  return (
    <>
      <Box
        px={["1.8%"]}
       pt={["1.5rem"]}
        display="flex"
        justifyContent={["center"]}
      >
        <Heading fontSize={["1.2rem"]} as="h2" color="#2c2c2c">
          <Box
            display={["inline-block"]}
            //   borderBottom="3px solid #e97730"
          >
            Hot Products
          </Box>
          <Box borderBottom="2px solid #e97730" py={["1"]} w={["60%"]} pos={["absolute"]} rig ></Box>
          {/* <Divider
            orientation="horizontal"
            py={["1"]}
          /> */}
        </Heading>
      </Box>
    </>
  );
};
const ProdContainer = ({ children, ...props }) => {
  return <Box as="prodContainer">{children}</Box>;
};

export default TrendingProduct;
